import react from 'react';
import {StyleSheet} from 'react-native';

const EstilosTextos = StyleSheet.create({
    tituloMenu: {
        fontSize: 50,
        color: '#f57542',
       justifyContent: 'center', alignItems:"center", height:"400px", width:"800px", borderStyle:"dotted", borderColor:"#000"

    },
    caixaBanner:{
        color:'Blue',
        fontWeight: 'bold',
        fontSize: 30
    },

    fundoTela: {
    backgroundColor: 'crimson'
    }
});   

export default EstilosTextos;
